import React from 'react';

import Banner from '../UI/Banner';
import Footer from '../UI/Footer';
import NavBar from '../UI/NavBar';

import classes from './Home.module.css';

const Home = () => {
  return (
    <div>
      <NavBar />
      <div className={classes.home}>
        <img
          src='https://firebasestorage.googleapis.com/v0/b/funix-way.appspot.com/o/xSeries%2FCCDN%2FReactJS%2FAssignment_Images%2FRJS101x_ASM03_04.png?alt=media&token=593a89ac-6679-461f-b040-ef78a76b678ahttps://firebasestorage.googleapis.com/v0/b/funix-way.appspot.com/o/xSeries%2FCCDN%2FReactJS%2FAssignment_Images%2FRJS101x_ASM03_04.png?alt=media&token=593a89ac-6679-461f-b040-ef78a76b678a'
          alt='banner'
        />
      </div>
      <Footer />
    </div>
  );
};

export default Home;
